import React from 'react';
// import { ReactComponent as Mob } from '../../assets/mob.svg';

const MobileNav = () => {
  return (
    <div className="mobile-nav">
      <div
        className="mob-nav-bg"
        style={{ backgroundImage: 'url(../../../../assets/mob.svg)' }}
      ></div>
    </div>
  );
};

export default MobileNav;
